import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
// import "./index.css";
import Sdata from "./Sdata";
ReactDOM.render(
  <>
    <h1>Netflix Top 10 Series</h1>
    <Card
      sname={Sdata[1].sname}
      imgSrc={Sdata[1].imgSrc}
      title={Sdata[1].title}
      link={Sdata[1].link}
      rating={Sdata[1].rating}
    />
    <Card
      sname={Sdata[2].sname}
      imgSrc={Sdata[2].imgSrc}
      title={Sdata[2].title}
      link={Sdata[2].link}
      rating={Sdata[2].rating}
    />
    <Card
      sname={Sdata[3].sname}
      imgSrc={Sdata[3].imgSrc}
      title={Sdata[3].title}
      link={Sdata[3].link}
      rating={Sdata[3].rating}
    />
    <Card
      sname={Sdata[4].sname}
      imgSrc={Sdata[4].imgSrc}
      title={Sdata[4].title}
      link={Sdata[4].link}
      rating={Sdata[4].rating}
    />
    <Card
      sname={Sdata[5].sname}
      imgSrc={Sdata[5].imgSrc}
      title={Sdata[5].title}
      link={Sdata[5].link}
      rating={Sdata[5].rating}
    />
    <Card
      sname={Sdata[6].sname}
      imgSrc={Sdata[6].imgSrc}
      title={Sdata[6].title}
      link={Sdata[6].link}
      rating={Sdata[6].rating}
    />
    <Card
      sname={Sdata[7].sname}
      imgSrc={Sdata[7].imgSrc}
      title={Sdata[7].title}
      link={Sdata[7].link}
      rating={Sdata[7].rating}
    />
    <Card
      sname={Sdata[8].sname}
      imgSrc={Sdata[8].imgSrc}
      title={Sdata[8].title}
      link={Sdata[8].link}
      rating={Sdata[8].rating}
    />
    <Card
      sname={Sdata[9].sname}
      imgSrc={Sdata[9].imgSrc}
      title={Sdata[9].title}
      link={Sdata[9].link}
      rating={Sdata[9].rating}
    />

  </>,
  document.getElementById("root")
);
